import React from "react";
import "./Home.css";

const Home = () => {
  return (
    <div className="row">
      {/* Left: Image */}
      <div className="column left">
        <img
          src="assets/Hero.pnh"
          alt="Example"
          className="image"
        />
      </div>

      {/* Right: Content */}
      <div className="column right">
        <h1>Full Width Layout</h1>
        <p>
          This layout spans the full width of your screen. The left side
          displays an image, while the right side contains your text and a
          button.
        </p>
        <button>Learn More</button>
      </div>
    </div>
  );
};

export default Home;
